import React, {Fragment} from "react";

const List  = (props) => {
    console.log(props)
    return (
      <Fragment>
        <li id={props.key}>{props.order}</li>
        <button id={props.id} type="submit">Delete</button>
        </Fragment>
    )
}

export default List;
